import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../Home/Assets/logo3.jpg'
import '../Header/Header.css'

function Header() {
    return (
        <div className="nav-sec">
            <div className="nav-head">
       
       <div className="nav-logo" ><img src={logo}></img>
          <h2>Hope Care</h2></div>
            <nav className="nav-button ">
                <Link to='/' className='nav-text'><h4 >Home</h4></Link>
                <Link to='/facility' className='nav-text'><h4 >Facility</h4></Link>
                <Link to='/appointment' className='nav-text'><h4 >Appointment</h4></Link>
                <Link to='/admin' className='nav-text'><h4 >Admin</h4></Link>
            </nav>
            </div>
        </div>
    );
}

export default Header;
